import React, { Component } from 'react';

const Context = React.createContext;

export class Provider extends Component {
    state = {
        user: {
            email: "",
            firstName: "",
            lastName: "",
            authed: false,
            authToken: null
          }
    }

    render() {
        return (
            <Context.Provider>
                {this.props.children}
               </Context.Provider>
        )
    }
}

export const Consumer = Context.Consumer;
